INSERT INTO `article` (`id_art`, `titre_art`, `cont1_art`, `cont2_art`, `cit_art`, `aut_art`, `photo1_art`, `photo2_art`, `date_art`, `vue_art`, `stat_art`, `id_user`) VALUES
(1, 'Journée Internationale du droit de la femme', 'Célébrée le 8 mars chaque année, la Journée Internationale des Droits des Femmes a pour but de susciter la réflexion sur les conditions des femmes dans le monde et de lutter contre les inégalités ; vu que cette célébration mémorable tire son origine d’un contexte de lutte des femmes au début du XXe siècle pour acquérir des droits déjà accordés aux hommes et de meilleures conditions de travail.</p>\r\n                                    <p>C’est à juste titre, dans la saine perspective de favoriser l’autonomie de la femme, que la Jeunesse Etudiante Catholique, accorde toujours une place prépondérante à la promotion de la femme. Plusieurs lucarnes sont trouvées afin d’accomplir ce dessein commun de valorisation de la femme ; dessein faisant l’objet de cette célébration. Initialement, si cette commémoration avait été instituée pour permettre aux femmes d’avoir le droit de vote, de pouvoir occuper des postes, de travailler et d’avoir une formation professionnelle, il parait important de noter les avancées considérables de la JEC-CI à ce niveau. En effet, nonobstant les efforts à consentir davantage, nous sommes parvenus à favoriser l’intégration des filles et leur accession à certains postes de responsabilité. Selon les dernières statistiques reçues et consolidées au plan national, sur trois cent quarante huit (348) sections, quatre-vingt-sept (87) filles sont responsables d’instances et quatre cent treize (413) restent membres de bureau ; résultats pas encore définitifs pour le compte de cette année 2019. Aussi est-il utile de rappeler que la promotion du genre féminin dans notre mouvement se matérialise à travers la tenue des activités filles dans chaque instance sur les thèmes de leadership, de l’autonomisation, l’entrepreneuriat, l’éducation et la santé. Visiblement, ces activités permettront d’établir un juste équilibre entre les genres. Subséquemment, le projet de la mise en place d’une base de données, d’anciennes jécistes battantes, leaders et émancipées permettra de sensibiliser nos filles aux droits et devoirs des femmes en leur présentant des modèles intègres et dignes.', 'Conjointement, cette année, pour ne point rester en marge du thème : « Penser équitablement, bâtir intelligemment, innover pour le changement », proposé par les Nations Unies, de par la vibrante déclaration de Phumzile Mlambo-Ngcuka, Sous-Secrétaire générale des Nations Unies et Directrice exécutive d’ONU Femmes, le 06 mars 2019, l’Etat de Côte d’Ivoire a bien voulu placé cette journée sous le leitmotiv suivant : « Le numérique, une solution pour l’autonomisation des femmes ».</p>                                     <p>Ce jour est donc pour nous, en plus des activités déjà menées, le moment privilégié pour inciter toutes les jeunes filles, membres de la JEC-CI, en particulier, à s’intéresser résolument au numérique et à utiliser cet atout de notre ère pour multiplier les messages visant à promouvoir l’autonomisation des femmes, l’égalité, les droits et devoirs des personnes, sans discrimination aucune ; ceci pour déstabiliser ces schèmes de pensées ou intentions malsaines visant à utiliser le numérique pour dévaloriser la femme ou la présenter comme un simple instrument. Pour dire bref, c’est un vif appel du cœur que nous lançons en ce jour de célébration aux ainées et jécistes actuelles.</p>                                     <p>Notre mission : valoriser la femme sans créer de différence entre les personnes.</p>                                     <p>Fait à Abidjan, le 8 Mars 2019 <br>Pour la JEC-CI <br>Céline SEBEGO <br>Secrétaire Générale Adjointe chargée de la mobilisation des filles.', 'Être une femme ne suffit pas de nos jours, il faut être une femme capable de répousser les limites de sa féminité et accomplir des exploits au même titre qu\'un homme.', 'Mme Constance GODE épouse KOUAKOU', 'blog1-cover.jpg', 'blog1-illus.jpg', '2019-03-08', 4, 'Invisible', 8),
(2, 'Carême 2019: Message du Pape François', 'Chers frères et sœurs,Chaque année, Dieu, avec le secours de notre Mère l’Eglise, « accorde aux chrétiens de se préparer aux fêtes pascales dans la joie d’un cœur purifié » (Préface de Carême 1) pour qu’ils puissent puiser aux mystères de la rédemption, la plénitude offerte par la vie nouvelle dans le Christ. Ainsi nous pourrons cheminer de Pâques en Pâques jusqu’à la plénitude du salut que nous avons déjà reçue grâce au mystère pascal du Christ : « Car nous avons été sauvés, mais c’est en espérance » (Rm 8,24). Ce mystère de salut, déjà à l’œuvre en nous en cette vie terrestre, se présente comme un processus dynamique qui embrasse également l’Histoire et la création tout entière. Saint Paul le dit : « La création attend avec impatience la révélation des fils de Dieu » (Rm8,19). C’est dans cette perspective que je souhaiterais offrir quelques points de réflexion pour accompagner notre chemin de conversion pendant le prochain carême.</p>\r\n                                    <p><b>1. La rédemption de la Création</b></p>\r\n                                    <p>La célébration du Triduum pascal de la passion, mort et résurrection du Christ, sommet de l’année liturgique, nous appelle, chaque fois, à nous engager sur un chemin de préparation, conscients que notre conformation au Christ (cf. Rm 8,29) est un don inestimable de la miséricorde de Dieu.</p>\r\n                                    <p>Si l’homme vit comme fils de Dieu, s’il vit comme une personne sauvée qui se laisse guider par l’Esprit Saint (cf. Rm 8,14) et sait reconnaître et mettre en œuvre la loi de Dieu, en commençant par celle qui est inscrite en son cœur et dans la nature, alors il fait également du bien à la Création, en coopérant à sa rédemption. C’est pourquoi la création, nous dit Saint Paul, a comme un désir ardent que les fils de Dieu se manifestent, à savoir que ceux qui jouissent de la grâce du mystère pascal de Jésus vivent pleinement de ses fruits, lesquels sont destinés à atteindre leur pleine maturation dans la rédemption du corps humain. Quand la charité du Christ transfigure la vie des saints – esprit, âme et corps –, ceux-ci deviennent une louange à Dieu et, par la prière, la contemplation et l’art, ils intègrent aussi toutes les autres créatures, comme le confesse admirablement le « Cantique des créatures » de saint François d’Assise (cf. Enc. Laudato Sì, n. 87). En ce monde, cependant, l’harmonie produite par la rédemption, est encore et toujours menacée par la force négative du péché et de la mort.</p>\r\n\r\n                                    <p><b>2. La force destructrice du péché</b></p>\r\n                                    <p>En effet, lorsque nous ne vivons pas en tant que fils de Dieu, nous mettons souvent en acte des comportements destructeurs envers le prochain et les autres créatures, mais également envers nous-mêmes, en considérant plus ou moins consciemment que nous pouvons les utiliser selon notre bon plaisir. L’intempérance prend alors le dessus et nous conduit à un style de vie qui viole les limites que notre condition humaine et la nature nous demandent de respecter. Nous suivons alors des désirs incontrôlés que le Livre de la Sagesse attribue aux impies, c’est-à-dire à ceux qui n’ont pas Dieu comme référence dans leur agir, et sont dépourvus d’espérance pour l’avenir (cf. 2,1-11). Si nous ne tendons pas continuellement vers la Pâque, vers l’horizon de la Résurrection, il devient clair que la logique du « tout et tout de suite », du « posséder toujours davantage » finit par s’imposer.</p>\r\n                                    <p>La cause de tous les maux, nous le savons, est le péché qui, depuis son apparition au milieu des hommes, a brisé la communion avec Dieu, avec les autres et avec la création à laquelle nous sommes liés avant tout à travers notre corps. La rupture de cette communion avec Dieu a également détérioré les rapports harmonieux entre les êtres humains et l’environnement où ils sont appelés à vivre, de sorte que le jardin s’est transformé en un désert (cf. Gn 3,17-18). Il s’agit là du péché qui pousse l’homme à se tenir pour le dieu de la création, à s’en considérer le chef absolu et à en user non pas pour la finalité voulue par le Créateur mais pour son propre intérêt, au détriment des créatures et des autres.</p>\r\n                                    <p>Quand on abandonne la loi de Dieu, la loi de l’amour, c’est la loi du plus fort sur le plus faible qui finit par s’imposer. Le péché qui habite dans le cœur de l’homme (cf. Mc 7, 20-23) – et se manifeste sous les traits de l’avidité, du désir véhément pour le bien-être excessif, du désintérêt pour le bien d’autrui, et même souvent pour le bien propre – conduit à l’exploitation de la création, des personnes et de l’environnement, sous la motion de cette cupidité insatiable qui considère tout désir comme un droit, et qui tôt ou tard, finira par détruire même celui qui se laisse dominer par elle.', '<b>3. La force de guérison du repentir et du pardon</b></p>\r\n                                    <p>C’est pourquoi la création a un urgent besoin que se révèlent les fils de Dieu, ceux qui sont devenus “une nouvelle création” : « Si donc quelqu’un est dans le Christ, il est une créature nouvelle. Le monde ancien s’en est allé, un monde nouveau est déjà né » (2 Co 5,17). En effet, grâce à leur manifestation, la création peut elle aussi « vivre » la Pâque : s’ouvrir aux cieux nouveaux et à la terre nouvelle (cf. Ap 21,1). Le chemin vers Pâques nous appelle justement à renouveler notre visage et notre cœur de chrétiens à travers le repentir, la conversion et le pardon afin de pouvoir vivre toute la richesse de la grâce du mystère pascal.</p>\r\n                                    <p>Cette “impatience ”, cette attente de la création, s’achèvera lors de la manifestation des fils de Dieu, à savoir quand les chrétiens et tous les hommes entreront de façon décisive dans ce “labeur” qu’est la conversion. Toute la création est appelée, avec nous, à sortir « de l’esclavage de la dégradation, pour connaître la liberté de la gloire donnée aux enfants de Dieu » (Rm 8,21). Le carême est un signe sacramentel de cette conversion. Elle appelle les chrétiens à incarner de façon plus intense et concrète le mystère pascal dans leur vie personnelle, familiale et sociale en particulier en pratiquant le jeûne, la prière et l’aumône.</p>\r\n                                    <p>Jeûner, c’est-à-dire apprendre à changer d’attitude à l’égard des autres et des créatures : de la tentation de tout “ dévorer” pour assouvir notre cupidité, à la capacité de souffrir par amour, laquelle est capable de combler le vide de notre cœur. Prier afin de savoir renoncer à l’idolâtrie et à l’autosuffisance de notre moi, et reconnaître qu’on a besoin du Seigneur et de sa miséricorde.Pratiquer l’aumône pour se libérer de la sottise de vivre en accumulant toute chose pour soi dans l’illusion de s’assurer un avenir qui ne nous appartient pas. Il s’agit ainsi de retrouver la joie du dessein de Dieu sur la création et sur notre cœur, celui de L’aimer, d’aimer nos frères et le monde entier, et de trouver dans cet amour le vrai bonheur.</p>\r\n                                    <p>Chers frères et sœurs, le « carême » du Fils de Dieu a consisté à entrer dans le désert de la création pour qu’il redevienne le jardin de la communion avec Dieu, celui qui existait avant le péché originel (cf. Mc 1,12-13 ; Is 51,3). Que notre Carême puisse reparcourir le même chemin pour porter aussi l’espérance du Christ à la création, afin qu’« elle aussi, libérée de l’esclavage de la dégradation, puisse connaître la liberté de la gloire donnée aux enfants de Dieu » (cf. Rm 8,21). Ne laissons pas passer en vain ce temps favorable ! Demandons à Dieu de nous aider à mettre en œuvre un chemin de vraie conversion. Abandonnons l’égoïsme, le regard centré sur nous-mêmes et tournons-nous vers la Pâque de Jésus : faisons-nous proches de nos frères et sœurs en difficulté en partageant avec eux nos biens spirituels et matériels. Ainsi, en accueillant dans le concret de notre vie la victoire du Christ sur le péché et sur la mort, nous attirerons également sur la création sa force transformante.</p>\r\n                                    <p>Du Vatican, le 4 octobre 2018 Fête de Saint François d’Assise. <br>FRANÇOIS', 'La création attend avec impatience la révélation des fils de Dieu', 'Rm 8,19', 'blog2-cover.jpg', 'blog2-illus.jpg', '2019-03-06', 3, 'Invisible', 8),
(3, 'EXHORTATION APOSTOLIQUE POUR LES JEUNES', 'Il vit, le Christ, notre espérance et il est la plus belle jeunesse de ce monde. Tout ce qu’il touche devient jeune, devient nouveau, se remplit de vie. Les premières paroles que je voudrais adresser à chacun des jeunes chrétiens sont donc : Il vit et il te veut vivant !</p>\r\n                                    <p>Il est en toi, il est avec toi et jamais ne t’abandonne. Tu as beau t’éloigner, le Ressuscité est là, t’appelant et t’attendant pour recommencer. Quand tu te sens vieilli par la tristesse, les rancœurs, les peurs, les doutes ou les échecs, il sera toujours là pour te redonner force et espérance.</p>\r\n                                    <p>A vous tous, jeunes chrétiens, j’écris avec affection cette Exhortation apostolique, c’est-à-dire une lettre qui rappelle certaines convictions de foi et qui, en même temps, encourage à grandir en sainteté et dans l’engagement de sa propre vocation. Mais étant donné qu’il s’agit d’une balise sur un chemin synodal, je m’adresse en même temps à tout le peuple de Dieu, à ses pasteurs et à ses fidèles, car la réflexion sur les jeunes et pour les jeunes nous interpelle et nous stimule tous. Par conséquent, dans certains paragraphes, je m’adresserai directement aux jeunes et, dans d’autres, je ferai des approches plus générales pour le discernement ecclésial.</p>\r\n                                    <p>Je me suis laissé inspirer par la richesse des réflexions et des échanges du Synode de l’année passée. Je ne pourrai pas présenter ici toutes les contributions, que vous pourrez lire dans le Document final, mais j’ai essayé d’inclure dans la rédaction de cette lettre les propositions qui m’ont paru les plus significatives. Ainsi, ma parole sera chargée de mille voix de croyants du monde entier qui ont fait parvenir leurs opinions au Synode. Même les jeunes non croyants, qui ont voulu y prendre part par leurs réflexions, ont soulevé des questions qui ont suscité en moi de nouvelles interrogations.', 'Recueillons certains trésors des Saintes Écritures, où, à plusieurs reprises, on parle des jeunes et de la façon dont le Seigneur va à leur rencontre.</p>\r\n                                    <p><b>Dans l’Ancien Testament</b></p>\r\n                                    <p>A une époque où les jeunes comptaient peu, certains textes montrent que Dieu a sur eux un autre regard. Par exemple, nous voyons que Joseph était presque le plus jeune de la famille (cf. Gn 37, 2-3). Toutefois, Dieu lui communiquait de grandes choses en rêve et il a dépassé tous ses frères dans les tâches importantes lorsqu’il avait environ vingt ans (cf. Gn 37-47).</p>\r\n                                    <p>En Gédéon, nous reconnaissons la sincérité des jeunes, qui n’ont pas l’habitude d’édulcorer la réalité. Quand on lui a annoncé que le Seigneur était avec lui, il a répondu : « Si Yahvé est avec nous, d\'où vient tout ce qui nous arrive ? » (Jg 6, 13). Mais Dieu ne s’est pas senti offensé par ce reproche et a doublé la mise pour lui : « Va avec la force qui t\'anime et tu sauveras Israël » (Jg 6, 14). </p>\r\n                                    <p>Samuel était un jeune peu sûr de lui-même, mais le Seigneur parlait avec lui. Sur le conseil d’un adulte, il a ouvert son cœur pour écouter l’appel de Dieu : « Parle, Seigneur, car ton serviteur écoute » (1 S 3, 9-10). C’est pourquoi il a été un grand prophète qui est intervenu en des moments importants pour sa patrie. Le roi Saül, lui aussi, était jeune quand le Seigneur l’a appelé à accomplir sa mission (cf. 1 S 9, 2).</p>\r\n                                    <p>Le roi David a été choisi alors qu’il était un jeune garçon. Quand le prophète Samuel était à la recherche du futur roi d’Israël, un homme lui a présenté comme candidats ses enfants aînés et les plus expérimentés. Mais le prophète a fait savoir que l’élu était le jeune David qui gardait les brebis (cf. 1 S 16, 6-13), car « l\'homme regarde à l\'apparence, mais le Seigneur regarde au cœur » (v. 7). La gloire de la jeunesse était plus dans le cœur que dans la force physique ou dans l’impression que l’on donne aux autres.</p>\r\n                                    <p>Salomon, quand il a dû succéder à son père, s’est senti perdu et a dit à Dieu : « Moi, je suis un tout jeune homme, je ne sais pas agir en chef » (1 R 3, 7). Cependant, l’audace de la jeunesse l’a amené à demander à Dieu la sagesse et il s’est consacré à sa mission. Quelque chose de semblable est arrivé au prophète Jérémie appelé, alors qu’il était très jeune, à réveiller son peuple. Dans son désarroi, il a dit : « Ah! Seigneur, vraiment, je ne sais pas parler, car je suis un enfant ! » (Jr 1, 6). Mais le Seigneur lui a demandé de ne pas dire cela (cf. Jr 1, 7), et il a ajouté : « N\'aie aucune crainte en leur présence car je suis avec toi pour te délivrer » (Jr 1, 8). Le dévouement du prophète Jérémie dans sa mission montre ce qui est possible si le courage de la jeunesse s’allie à la force de Dieu.</p>\r\n                                    <p>Une jeune juive, qui était au service du soldat étranger Naman, est intervenue avec foi pour l’aider à se soigner de sa maladie (cf. 2 R 5, 2-6). La jeune Ruth a été un exemple de générosité en restant avec sa belle-mère tombée en disgrâce (cf. Rt 1, 1-18), et elle a montré également son audace en allant de l’avant dans la vie (cf. Rt 4, 1-17).</p>\r\n                                    <p><b>Dans le nouveau Testament</b></p>\r\n                                    <p>Une parabole de Jésus (cf. Lc 15, 11-32) raconte que le “plus jeune” fils a voulu partir de la maison paternelle pour un pays lointain (cf. vv. 12.13). Mais ses rêves d’autonomie se sont transformés en libertinage et en débauche (cf. vv. 12-13) et il a éprouvé la rigueur de la solitude et de la pauvreté (cf. vv. 14-16). Toutefois, il a su se reprendre pour un nouveau départ (cf. vv. 17-19) et il a décidé de se lever (cf. v. 20).  C’est la caractéristique du cœur jeune d’être disponible au changement, d’être capable de se relever et de se laisser instruire par la vie. Comment ne pas accompagner le fils dans cette nouvelle tentative ? Mais le frère aîné avait déjà le cœur vieilli et il s’est laissé posséder par l’avidité, l’égoïsme et l’envie (cf. vv. 28-30). Jésus fait plus l’éloge du jeune pécheur qui retrouve le bon chemin que l’éloge de celui qui se croit fidèle mais ne vit pas l’esprit d’amour et de miséricorde.</p>\r\n                                    <p>Jésus, l’éternel jeune, veut nous faire don d’un cœur toujours jeune. La Parole de Dieu nous demande : « Purifiez-vous du vieux levain pour être une pâte nouvelle » (1 Co 5, 7). Elle nous invite en même temps à nous dépouiller du “vieil homme” pour revêtir l’homme “nouveau” (cf. Col 3, 9.10).[1]  Et quand elle explique ce que signifie se revêtir de cette jeunesse qui se renouvelle (cf. v.10), elle affirme qu’il s’agit de revêtir « des sentiments de tendre compassion, de bienveillance, d\'humilité, de douceur, de patience, et de se supporter les uns les autres en se pardonnant mutuellement » (Col 3, 12-13). Cela signifie que la vraie jeunesse, c’est avoir un cœur capable d’aimer. En revanche, ce qui vieillit l’âme, c’est tout ce qui nous sépare des autres. Mais elle conclut ainsi : « Par-dessus tout, ayez la charité, en laquelle se noue la perfection » (Col 3, 14).</p>\r\n                                    <p>Remarquons que Jésus n’appréciait pas que les personnes adultes regardent avec mépris les plus jeunes ou les maintiennent à leur service de manière despotique. Au contraire, il demandait : « Que le plus grand parmi vous se comporte comme le plus jeune, et celui qui gouverne comme celui qui sert » (Lc 22, 26). Pour lui, l’âge n’établissait pas de privilèges, et le fait que quelqu’un soit moins âgé ne signifiait pas qu’il valait moins ou qu’il avait moins de dignité.</p>\r\n                                    <p>La Parole de Dieu dit qu’il faut traiter les jeunes gens « comme des frères » (1 Tm 5, 1), et elle recommande aux parents : « N’exaspérez pas vos enfants, de peur qu’ils ne se découragent » (Col 3, 21). Un jeune ne peut pas se décourager, il doit rêver de grandes choses, chercher de larges horizons, aspirer à plus, vouloir conquérir le monde, être capable d’accepter des propositions provocantes et souhaiter apporter le meilleur de lui-même pour construire quelque chose de meilleur. Voilà pourquoi j’invite avec insistance les jeunes à ne pas se laisser dérober l’espérance, et je répète à chacun : « Que personne ne méprise ton jeune âge » (1 Tm 4, 12).</p>\r\n                                    <p>Cependant, en même temps, il est recommandé aux jeunes : « Soyez soumis aux anciens (1 P 5, 5). La Bible invite toujours à un profond respect envers les anciens, car ils possèdent un trésor d’expérience, ont connu les succès et les échecs, les joies et les grandes angoisses de la vie, les illusions et les déceptions, et ils gardent, dans le silence de leur cœur, beaucoup d’histoires qui peuvent nous aider à ne pas nous tromper ni nous laisser entraîner par de faux mirages. La parole d’un aîné sage invite à respecter certaines limites et à savoir se dominer au bon moment : « Exhorte également les jeunes gens à garder en tout la pondération » (Tt2, 6). Il ne convient pas de tomber dans un culte de la jeunesse, ou dans une attitude juvénile qui méprise les autres à cause de leur âge, ou parce qu’ils sont d’une autre époque. Jésus disait que la personne sage est capable de tirer de son trésor aussi bien du nouveau que du vieux (cf. Mt 13, 52).  Un jeune sage s’ouvre à l’avenir, mais il est toujours capable de recueillir quelque chose de l’expérience des autres.</p>\r\n                                    <p>Dans l’Evangile de Marc, apparaît une personne qui, lorsque Jésus lui rappelle les commandements, dit : « Tout cela, je l\'ai observé dès ma jeunesse » (10, 20). Le psalmiste l’affirmait déjà : « Car c\'est toi mon espoir, Seigneur, […] ma foi dès ma jeunesse. […] Tu m\'as instruit dès ma jeunesse, et jusqu\'ici j\'annonce tes merveilles » (71, 5.17). Il ne faut pas regretter de passer sa jeunesse en étant bon, en ouvrant son cœur au Seigneur, en vivant d’une autre manière. Rien de tout cela ne nous ôte la jeunesse mais plutôt la renforce et la renouvelle : « Ta jeunesse se renouvelle comme celle de l’aigle » (Ps 103, 5). C’est pourquoi saint Augustin déplorait : « Je t\'ai aimée bien tard, Beauté si ancienne et si nouvelle, je t\'ai aimée bien tard ! ».[2]  Mais cet homme riche, qui avait été fidèle à Dieu dans sa jeunesse, a laissé le temps lui ôter les rêves et a préféré continuer à s’attacher à ses biens (cf. Mc10, 22). </p>\r\n                                    <p>En revanche, dans l’Evangile de Matthieu, se présente un jeune (cf. 19, 20.22) qui s’approche de Jésus pour lui demander davantage (cf. v. 20), avec cet esprit ouvert propre aux jeunes en recherche de nouveaux horizons et de grands défis. En réalité, son esprit n’était pas si jeune, car il était attaché aux richesses et au confort. Il disait en paroles qu’il voulait quelque chose de plus, mais quand Jésus lui a demandé d’être généreux et de partager ses biens, il s’est rendu compte qu’il était incapable de se dépouiller de ce qu’il possédait. En fin de compte, en « entendant cette parole, le jeune homme s\'en alla contristé, car il avait de grands biens » (v. 22). Il avait renoncé à sa jeunesse.</p>\r\n                                    <p>L’Evangile nous parle également de quelques jeunes filles prudentes, qui étaient vigilantes et attentives, tandis que d’autres étaient distraites et endormies (cf. Mt 25, 1-13). En effet, on peut passer sa jeunesse en étant distrait, en vivant superficiellement, endormi, incapable de cultiver des relations profondes et d’entrer au cœur de la vie. On prépare ainsi un avenir pauvre, sans substance. Ou bien on peut passer sa jeunesse à cultiver de belles et grandes choses, et ainsi on prépare un avenir rempli de vie et de richesse intérieure.</p>\r\n                                    <p>Si tu as perdu la vigueur intérieure, les rêves, l’enthousiasme, l’espérance et la générosité, Jésus se présente à toi comme il l’a fait pour l’enfant mort de la veuve, et avec toute sa puissance de Ressuscité le Seigneur t’exhorte : « Jeune homme, je te le dis, lève-toi » (Lc 7, 14).</p>\r\n                                    <p>Il y a sans doute beaucoup d’autres textes de la Parole de Dieu qui peuvent nous éclairer sur cette étape de la vie. Nous recueillerons certains d’entre eux dans les prochains chapitres.</p>\r\n                                    <p><b>François</b>', 'QUE DIT LA PAROLE DE DIEU SUR LES JEUNES ?', '', 'blog3-cover.jpg', 'blog3-illus.jpg', '2019-03-25', 0, 'Visible', 8),
(4, 'Affectations des membres du Bureau National 2019-2020', 'Au titre de l\'année pastorale 2019-2020, la répartition des tâches est la suivante:\r\n\r\n<h2>Délégation</h2>\r\n<b>Abengourou</b> : Kiplé José Rodrigue <br>\r\n<b>Abidjan</b> : Ouei Gueu Olive<br>\r\n<b>Agboville</b> : Kouakou Jean Marie<br>\r\n<b>Bondoukou</b> : Ouei Gueu Olive<br>\r\n<b>Bouake</b> : Gnally Franck Olivier <br>\r\n<b>Daloa</b> : KOFFI Prisca <br>\r\n<b>Gagnoa</b> : Badou Aristide<br>\r\n<b>Grand-Bassam</b> : Adia Glwadys <br>\r\n<b>Katiola</b> : Donga Paterne <br>\r\n<b>Korhogo</b> : Yao Richard <br>\r\n<b>Man</b> :  Kouakou Hyacinthe <br>\r\n<b>Odienne</b> : Kouya Romuald <br>\r\n<b>San Pedro</b> : Sebego Celine <br>\r\n<b>Yamoussoukro</b> : Niamien Assassy René <br>\r\n<b>Yopougon</b> :Yao Richard<br>\r\n\r\n', ' <h2>Points focaux</h2>\r\n<b>Formation et éducation</b> : Yao Richard<br>\r\n<b>Spiritualité</b> : Koffi Prisca<br>\r\n<b>Retour de la JEC lycées et collèges</b> : Kouakou Jean Marie <br>\r\n<b>Retour de la JEC grandes écoles et universités </b>: Niamien Assassy René et Gnally Franck Olivier<br>\r\n<b>Communication</b> : Kouakou Hyacinthe et Badou Aristide<br>\r\n<b>Gestion administrative du mouvement </b>: Kiplé José Rodrigue et Adia Glwadys <br>\r\n<b>Gestion financière et projet</b> : Donga Paterne<br>\r\n<b>Relations et partenariats</b> : Kouakou Ella et Koffi Prisca<br>\r\n<b>Contentieux et affaires juridiques</b> : Kouya Romuald <br>\r\n<b>Affaires sociales</b> : Ouei Gueu Olive<br>\r\n<b>Mobilisation des filles</b> : Sebego Céline<br><br>\r\n\r\nLe Bureau National profite de cette lucarne pour remercier tous les membres des bureaux d\'instances 2018-2019. Puisse le Seigneur Jésus-Christ récompenser vos efforts.\r\nFructueuse année pastorale 2019-2020 à tous! ', ' Appliquez vous à bien faire les choses car Dieu ne récompense pas le verbe faire mais l\'adverbe bien. Peu Lui importe le ', ' Saint Bernard de Clairvaux', 'blog4-cover.png', 'blog4-illus.png', '2019-09-17', 0, 'Visible', 8),
(5, 'Top 5 des astuces pour une fructueuse rentrée pastorale', 'La rentrée pastorale est le meilleur moment pour attirer de nouveaux membres. C’est un travail minutieux à effectuer. D’ailleurs, la clé d’une section mobilisée réside en partie dans le butin de cette activité.\r\nEtes-vous intéressés par quelques astuces ? Nous vous offrons à l’orée de la nouvelle année pastorale, un top 5 des astuces pour recruter au maximum.<br><br>\r\n\r\n	<b>1.	Le stand</b><br>\r\n\r\nIl faut fonctionner de manière très professionnelle. Dresser une table et des éléments qui rendent visible la section.\r\n	⁃	Les photos : épinglées sur un tableau, un kakémono ou une bâche (peu importe le support), il est impératif de présenter les images des activités précédentes afin de donner un aperçu concret de la vie du mouvement.\r\n	⁃	Les distinctions : aussi minimes sont-elles, nos distinctions attirent les jeunes qui ont des prédispositions pour être jécistes ????. Médailles, trophées ou encore diplômes, il faut présenter le mouvement comme la sphère des élites, la caste des meilleurs.\r\n	⁃	La documentation : en plus de présenter sur la table les articles JEC, il faut aussi stocker obligatoirement pour distribution, de petits feuillets précisant les grandes lignes de la section, les contacts et informations, le jour et l’heure de réunion. Veillez à en disposer au moins quatre par page pour réduire les coûts d’impression.\r\n	⁃	La liste d’inscription : il faut absolument emmener chaque visiteur à y marquer nom, prénoms, contact et/ou WhatsApp, Facebook, lieu d’habitation et niveau d’études. Voici une base qui doit être exploitée au soir de la rentrée pastorale afin de motiver les inscrits à venir à la prochaine réunion.<br><br>\r\n\r\n	<b>2.	L’animation</b><br>\r\n\r\n	⁃	Ambiance festive : Tam-tam, battements de main, voix suave ou rock, nous jécistes sommes réputés pour notre ambiance facile. A travers des chants bien rythmés, les tenanciers du stand doivent se faire le plus entendre pour attirer les visiteurs. Il y a à ce niveau des « chants JEC fétiches » pour attirer les jeunes (à lire dans un prochain article). Il faut également synchroniser les pas de danse pour montrer l’ordre, l’harmonie et la solidarité du mouvement.\r\n	⁃	Ambiance instructive : certains jeunes peuvent demander les buts et missions de la JEC et se renseigner sur l’importance de la vie associative. Il faudrait préparer une sorte de foire aux questions pour ne pas être penaud pendant les échanges.\r\n', '<b>3.	Le cocktail</b><br>\r\n\r\nUn adage populaire dit que « c’est autour des repas que Jésus prenait les grandes décisions ». A la JEC, le partage renforce l’engagement des uns et des autres. Il faut donc prévoir sur la table à manger et à boire pour les visiteurs.\r\n	⁃	Jus \r\n	⁃	Soda \r\n	⁃	Pâtisserie salée ou sucrée \r\nEn donnant en portion réduite avec le sourire à tous les visiteurs.<br><br>\r\n\r\n	<b>4.	La constitution de l’équipe</b><br>\r\n\r\nUn sérieux casting doit être opéré avant la mise en place. Les plus accueillants ayant une écriture soignée serviront derrière le stand tandis que les plus énergiques mettront l’ambiance. Les jécistes bien formés et ayant des voix pédagogiques pourront expliquer aux passants l’importance d’appartenir à cette association.\r\nQuant aux autres, ils pourront aider à la logistique, à l’accueil des visiteurs ou à la lutte infernale qui consiste à conduire tout jeune désintéressé vers le stand.<br><br>\r\n\r\n\r\n	<b>5.	Le choix de la tenue</b><br>\r\n\r\nLa tenue vestimentaire doit passer un message. Généralement en observant notre tenue, l’on décèle aisément ce que nous voulons, où nous allons et ce que nous ferons.\r\nIl faut donc mettre une tenue qui porte le message de la JEC et de ce que nous faisons à la JEC. Quoi de mieux que le T-shirt de l’action nationale qui porte notre logo, la carte nationale de notre pays, notre devise et surtout notre thème d’action nationale ?\r\nPour la rentrée pastorale, ne nous fatiguons pas à crier notre mission aux recrues, portons notre t-shirt d’action nationale et montrons leur notre dos, la quintessence y est.\r\n\r\nVoici pour nous le top 5 des astuces incontournables. Avez-vous d’autres méthodes ? Partagez avec nous votre expérience sur les réseaux sociaux avec le hashtag #rentrée_pastorale_jec . Cela aidera les sections à recruter de nouveaux membres.<br>\r\n', 'Qui veut aller loin, ménage sa monture', 'Jean Racine', 'blog5-cover.jpeg', 'blog5-illus.jpeg', '2019-10-12', 0, 'Visible', 9),
