INSERT INTO `formation` (`id`, `titre`, `description`, `type`, `date`, `auteur`) VALUES
(1, 'L\'IMPORTANCE DES BÉATITUDES DANS LA VIE DU CHRÉTIEN', 'La religion chrétienne (catholique) n’est pas celle qui fait l’apologie d’un bonheur tombé du\r\nciel, dont l’on pourrait bénéficier sans faire d\'effort. Le bonheur dont parlent les béatitudes est un\r\nbonheur qui demande des efforts considérables, surtout l’amour pour le prochain. Etre porté vers\r\nles autres, c’est cela pour nous le vrai sens des béatitudes.', 'Spirituelle', '2020-03-30', 8);
